import { Container, Row, Col } from 'react-bootstrap';
import './Tentang.css'; // Create a CSS file for additional styling if needed

export default function Tentang() {
    return (
        <Container className="tentang-container">
            <Row>
                <Col>
                    <h2>Tentang Kami</h2>
                    <h3>Selamat datang di Adlitech!</h3>
                    <p>
                        Kami memiliki keahlian di industri teknologi dan berkomitmen untuk memberikan solusi inovatif.
                        Dengan perhatian pada kepuasan pelanggan, kami siap menjadi mitra terpercaya Anda dalam mencapai
                        tujuan teknologi.
                    </p>
                </Col>
            </Row>
        </Container>
    );
}
